import {Component} from '@angular/core';
import {IonicPage, NavController, NavParams, MenuController, LoadingController} from 'ionic-angular';
import {BuscaFestasProvider} from "../../providers/busca-festas/busca-festas";
import {FestaDetalhePage} from "./festa-detalhe/festa-detalhe";
import {MyApp} from "../../app/app.component";


@IonicPage()
@Component({
    selector: 'page-home',
    templateUrl: 'home.html',
})
export class HomePage {
    public rootPage = HomePage;

    public search: string;
    public filtro = {};
    festa: Array<{ id: number, img_principal: any, nome: string, data: string, horario_inicio: string, presencas: number }>;

    constructor(public navCtrl: NavController,
                public navParams: NavParams,
                public menuCtrl: MenuController,
                private buscaFestasProvider: BuscaFestasProvider,
                public loadingCtrl: LoadingController) {

        this.festa = [
            {
                id: 1,
                img_principal: 'data:image/jpeg;base64,',
                nome: 'Bloco Pirraça 2017',
                data: '13/06/2017',
                horario_inicio: '22',
                presencas: 100
            },
            {
                id: 2,
                img_principal: 'data:image/jpeg;base64,',
                nome: 'CarnaFacul 2017',
                data: '20/06/2017',
                horario_inicio: '23',
                presencas: 200
            },
            {
                id: 3,
                img_principal: 'data:image/jpeg;base64,',
                nome: 'Patroa 2017',
                data: '23/06/2017',
                horario_inicio: '0',
                presencas: 300
            }
        ];

        // this.buscarFestas();
    }

    buscarFestas() {
        let loader = this.loadingCtrl.create({
            content: "Carregando..."
        });
        loader.present();

        this.buscaFestasProvider.buscarFestas()
            .then((resp) => {
                let json = resp.json();
                loader.dismiss();
                console.log("json: ", json);
            }).catch((err) => {
            loader.dismiss();
            console.log(err);
        });
    }

    ionViewDidEnter() {
        this.menuCtrl.enable(true);
        this.menuCtrl.swipeEnable(true);
    }

    detalhaFesta(id, nome, img) {
        this.navCtrl.push(FestaDetalhePage, {'id': id, 'nome': nome, 'img': img});
    }

    find(ev: any) {
        let val = ev.target.value;
        console.log("val: ", val);

        if ((val == '') || (val == undefined)) {
            this.search = '';
            //this.listarInspecao();
        }
    }

    openRightMenu(){
        console.log("Entrou no open right");
        this.menuCtrl.close('left');
        this.menuCtrl.toggle('right');
    }

    openLeftMenu(){
        console.log("Entrou no open left");
        this.menuCtrl.close('right');
        this.menuCtrl.toggle('left');
    }

    buscar(){
        this.menuCtrl.close('right');
        console.log("filtros: ", this.filtro);
    }
}
